import Foundation

private struct LocalReasoningModelPayload: Decodable {
    let schemaVersion: Int
    let modelName: String
    let trainedAtUTC: String
    let sampleCount: Int
    let labels: [String]
    let vocabulary: [String]
    let logPriors: [Double]
    let logLikelihoods: [[Double]]
    let nextActions: [String]
    let labelBriefs: [String]
    let keywordHints: [[String]]?
    let keywordBonus: Double?

    enum CodingKeys: String, CodingKey {
        case schemaVersion = "schema_version"
        case modelName = "model_name"
        case trainedAtUTC = "trained_at_utc"
        case sampleCount = "sample_count"
        case labels
        case vocabulary
        case logPriors = "log_priors"
        case logLikelihoods = "log_likelihoods"
        case nextActions = "next_actions"
        case labelBriefs = "label_briefs"
        case keywordHints = "keyword_hints"
        case keywordBonus = "keyword_bonus"
    }
}

actor LocalReasoningEngine {
    private let model: LocalReasoningModelPayload
    private let vocabIndex: [String: Int]
    private let keywordHints: [Set<String>]
    private let keywordBonus: Double

    init() {
        let loaded = Self.loadModel()
        self.model = loaded
        self.vocabIndex = Dictionary(uniqueKeysWithValues: loaded.vocabulary.enumerated().map { ($1, $0) })
        let hints = loaded.keywordHints ?? Array(repeating: [], count: loaded.labels.count)
        self.keywordHints = hints.map { Set($0) }
        self.keywordBonus = loaded.keywordBonus ?? 0.0
    }

    func modelStatusLine() -> String {
        "Local model active: \(model.modelName) · samples \(model.sampleCount) · trained \(model.trainedAtUTC)"
    }

    func reason(prompt: String, notes: [UserNote]) async -> LocalReasoningOutput {
        let normalized = prompt.trimmingCharacters(in: .whitespacesAndNewlines)
        if normalized.isEmpty {
            return LocalReasoningOutput(
                model: model.modelName,
                summary: "No prompt was provided.",
                nextAction: "Add one concrete prompt and run the queue again.",
                confidence: 0.0,
                generatedAt: Date()
            )
        }

        let noteContext = notes.prefix(4).map { "\($0.title) \($0.content)" }.joined(separator: " ")
        let combined = noteContext.isEmpty ? normalized : "\(normalized) \(noteContext)"
        let tokens = Self.tokenize(combined)
        let (labelIndex, confidence) = classify(tokens: tokens)

        let labelBrief = model.labelBriefs.indices.contains(labelIndex) ? model.labelBriefs[labelIndex] : "Atlas execution brief"
        let nextAction = model.nextActions.indices.contains(labelIndex)
            ? model.nextActions[labelIndex]
            : "Define one action for now, one for this week, and one for this quarter."

        return LocalReasoningOutput(
            model: model.modelName,
            summary: summarize(normalized, labelBrief: labelBrief, notesCount: notes.count),
            nextAction: nextAction,
            confidence: confidence,
            generatedAt: Date()
        )
    }

    private func classify(tokens: [String]) -> (Int, Double) {
        guard !model.labels.isEmpty,
              model.labels.count == model.logPriors.count,
              model.labels.count == model.logLikelihoods.count,
              let firstLikelihood = model.logLikelihoods.first,
              firstLikelihood.count == model.vocabulary.count
        else {
            return (0, 0.0)
        }

        var tokenHits = [Int: Int]()
        for token in tokens {
            if let idx = vocabIndex[token] {
                tokenHits[idx, default: 0] += 1
            }
        }
        let uniqueTokens = Set(tokens)

        var scores = model.logPriors
        for (tokIdx, count) in tokenHits {
            let tokenWeight = Double(count)
            for labelIdx in scores.indices {
                guard model.logLikelihoods[labelIdx].indices.contains(tokIdx) else { continue }
                scores[labelIdx] += model.logLikelihoods[labelIdx][tokIdx] * tokenWeight
            }
        }
        for labelIdx in scores.indices {
            guard keywordHints.indices.contains(labelIdx) else { continue }
            let matches = keywordHints[labelIdx].intersection(uniqueTokens).count
            scores[labelIdx] += Double(matches) * keywordBonus
        }

        var bestIdx = 0
        var bestScore = scores[0]
        for idx in scores.indices.dropFirst() where scores[idx] > bestScore {
            bestIdx = idx
            bestScore = scores[idx]
        }

        let confidence = softmaxConfidence(scores: scores, winner: bestIdx)
        return (bestIdx, confidence)
    }

    private func summarize(_ prompt: String, labelBrief: String, notesCount: Int) -> String {
        let firstSentence = prompt
            .split(whereSeparator: { ".?!\n".contains($0) })
            .first
            .map(String.init)
            ?? prompt

        let trimmed = firstSentence.trimmingCharacters(in: .whitespacesAndNewlines)
        let compact = trimmed.count > 180 ? String(trimmed.prefix(180)) + "..." : trimmed

        if notesCount > 0 {
            return "\(labelBrief): \(compact) | Context notes used: \(min(notesCount, 4))"
        }
        return "\(labelBrief): \(compact)"
    }

    private func softmaxConfidence(scores: [Double], winner: Int) -> Double {
        guard !scores.isEmpty, scores.indices.contains(winner), let maxScore = scores.max() else {
            return 0.0
        }

        let exps = scores.map { exp($0 - maxScore) }
        let denom = exps.reduce(0.0, +)
        guard denom > 0 else { return 0.0 }
        return min(0.995, exps[winner] / denom)
    }

    private static func tokenize(_ input: String) -> [String] {
        let unigrams = input
            .lowercased()
            .split(whereSeparator: { !$0.isLetter && !$0.isNumber })
            .map(String.init)
            .filter { $0.count >= 2 }

        if unigrams.count < 2 {
            return unigrams
        }

        let bigrams = zip(unigrams, unigrams.dropFirst()).map { "\($0)_\($1)" }
        return unigrams + bigrams
    }

    private static func loadModel() -> LocalReasoningModelPayload {
        if let data = defaultLocalReasoningModelJSON.data(using: .utf8),
           let decoded = try? JSONDecoder().decode(LocalReasoningModelPayload.self, from: data),
           decoded.labels.count == decoded.logPriors.count,
           decoded.labels.count == decoded.logLikelihoods.count,
           decoded.nextActions.count == decoded.labels.count,
           decoded.labelBriefs.count == decoded.labels.count
        {
            return decoded
        }

        return fallbackModel()
    }

    private static func fallbackModel() -> LocalReasoningModelPayload {
        LocalReasoningModelPayload(
            schemaVersion: 1,
            modelName: "atlas-local-reasoner-fallback",
            trainedAtUTC: "1970-01-01T00:00:00Z",
            sampleCount: 0,
            labels: ["execution_now", "technical_debug", "strategy_long_horizon"],
            vocabulary: ["execute", "error", "strategy"],
            logPriors: [-1.0986, -1.0986, -1.0986],
            logLikelihoods: [
                [-0.6931, -1.3862, -1.3862],
                [-1.3862, -0.6931, -1.3862],
                [-1.3862, -1.3862, -0.6931],
            ],
            nextActions: [
                "Execute one high-impact step in the next 15 minutes, then lock the next checkpoint.",
                "Capture the failing signal, isolate one root cause, and apply a minimal verified fix.",
                "Define the next strategic milestone and commit one measurable action this week.",
            ],
            labelBriefs: [
                "Immediate execution protocol",
                "Systems debugging and delivery",
                "Long-horizon strategy and capital",
            ],
            keywordHints: [
                ["execute", "today", "action"],
                ["error", "bug", "deploy"],
                ["strategy", "mission", "roadmap"],
            ],
            keywordBonus: 0.8
        )
    }
}

